import React from "react";

const Card = ({ pic, title, para, children }) => {
     return(
         <>
        <div className="card" style={{width: '18rem'}}>
             <img class="card-img-top" src={pic} alt="Card image cap"/>
             <div class="card-body">
               <h5 class="card-title">{title}</h5>
               <p class="card-text">{para}</p>
               <p></p>
               {children}
             </div>
        </div>
         </>
     )
}

export default Card;

